  getDisplayTypeValue() {
    return carouselItemsView.currentItem.getItem().displayType;
  },
  getPageTypeValue() {
    return carouselItemsView.currentItem.getItem().pageType;
  },
  showCarouselItem() {
    var item = carouselItemsView.currentItem.getItem();
    carouselItemsView.currentItem.displayType = item.displayType;
    carouselItemsView.currentItem.pageType = item.pageType;
    AlertLevelSelect.setSelectedOption(item.alertLevel);
    DurationInput.setValue(item.duration);
    TriggerTimeInput.setValue(item.triggerTime);
    Image.setImage(item.chartUrl);
    HabitSelect.setSelectedOption(item.habitId);
  }
